import styled from "styled-components";


export const InputStyled = styled.div`   
    input {
        max-height: 60px;
        width: 452px;
        border-radius: 8px;
        border: none;
        background-color: #F5F5F5;
        padding: 0 15px;
        font-size: 16px;
        font-weight: 400;
    }

    input:focus{
        outline: none;
        box-shadow: 0 0 3px 0 #00000050;
    }
`
